import React from "react";
import InputMain from "../InputMain";
import selectImg from "../../asset/images/select.svg";

const TodoReceiver = () => {
  return (
    <div className="receiver">
      <img src="selectImg" alt="selectImg" />
      <InputMain />
    </div>
  );
};

export default TodoReceiver;
